import React from 'react';
import './App.css';
import "./navBar.js";
import NavBar from "./navBar";


function App() {
    return (
        <div className="App">
            <title>Learning Square</title>
            <NavBar/>
            <div className="App-Frontpage">
                <image className="App-image"/>
            </div>
        </div>
    );
}

export default App;
